export const confirmWord = () => {
  return(dispatch)= dispatch({ type: "CONFIRM" });
};

export const nextWord = () => {
  return(dispatch)= dispatch({ type: "NEXT_WORD" });
};

export const prevWord = () => {
  return(dispatch)= dispatch({ type: "PREVIOUS_WORD" });
};
